import React, { Component } from 'react';
import Footer from '../Footer.js';
import ScrollDown from '../Helpers/ScrollDown.js';
import ContactForm from '../Form/ContactForm.js';
import Header from '../Header.js';
import '../../Assets/Styles/Contact.css';

class Contact extends Component {

  render() {
    return (

      <div className="wrapper">
        <Header headerImage = "contact-header-image" />

        <div className="container">
          <main>
            <section className="first-section">
              <h2 className="first-section-title">Kontakta oss</h2>
              <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. 
              Consequuntur inventore dolorum nulla.</p>
              <ScrollDown />
            </section>

            <map className="contact-map">

            </map>

            <ContactForm />
          </main>
        </div>

          <Footer />
        </div>

      )
  }
}

export default Contact;
